import React, { Component } from 'react';
import { Tabs } from 'react-simple-tabs-component';
import "./CoinsTab.css";
import Todayhot from '../Todayhot';

class CoinsTab extends Component {
	
	render() {

		// Tabs structure Array
		const tabs = [
			{
				label: 'Normal', // Tab Title - String
				Component: Todayhot // Tab Body - JSX.Element
			},
			{
				label: 'Today Hot',
				Component: Todayhot
			},
			{
				label: 'New',
				Component: Todayhot
			},
			{
				label: 'All Time Best',
				Component: Todayhot
			},
			{
				label: 'Presale',
				Component: Todayhot
			}
		]
		
		return (
			<div className="container" style={{width:'auto'}}>
				<div className="col-md-12">
					<h4 className="headline margin-top-30 margin-bottom-40"></h4>
					<Tabs tabs={tabs} /* Props */ />
				</div>
			</div>
		);
	}
}

export default CoinsTab;
